            inner[1]: 0x2233445566778899
            inner[2]: 0x1122334455667788
            inner[3]: 0x99AABBCCDDEEFF00
    */
    let input : [u8;32] = [
        0xAA, 0xBB, 0xCC, 0xDD,
        0xEE, 0xFF, 0x00, 0x11,
        0x22, 0x33, 0x44, 0x55,
        0x66, 0x77, 0x88, 0x99,
