        0x55, 0x66, 0x77, 0x88,
        0x99, 0xAA, 0xBB, 0xCC,
        0xDD, 0xEE, 0xFF, 0x00
    ];
    let result = U256::from_bytes32(input);

    assert(result.inner[0] == 0xAABBCCDDEEFF0011);
    assert(result.inner[1] == 0x2233445566778899);
    assert(result.inner[2] == 0x1122334455667788);
